  false,\n\t\"url\": null,\n\t\"notes\": \"The Global Tropics Hazards and Benefits
  Assessment (GTH) is an outlook product for the areas in the Tropics. Forecasts for
  the Week-1 and Week-2 period are given for areas of broad-scale enhanced rainfall,
  suppressed rainfall and potential tropical cyclogenesis. This product is updated
  weekly on Tuesday?s and makes use of many types of monitoring and prediction tools
  to make the forecasts. The product displayed here has undergone considerable evolution
  over the last few years. The current version of the product began in February 2011
  but an archive of past versions of the product is available.\",\n\t\"license_title\":
